import styled from "@emotion/styled";

const Container = styled.div`
  padding: 2rem 8rem;
  text-align: center;
`;

const BrandList = styled.div`
  display: flex;
  padding: 1rem 1rem 2rem 1rem;
  flex-direction: row;
`;

const BrandImageContainer = styled.div`
  > img {
    max-width: 70%;
    padding: 0rem 1rem;
  }
`;

export const PartnerCard = () => {
  return (
    <Container>
      <h2>แบรนด์ที่เข้าร่วมกับเรา</h2>
      <BrandList>
        <BrandImageContainer>
          <img alt="ยิปรอค" src="/assets/logo.png" />
        </BrandImageContainer>
        <BrandImageContainer>
          <img alt="เอสซีแอล" src="/assets/logo-without-text.png" />
        </BrandImageContainer>
        <BrandImageContainer>  
          <img alt="ตรงช้าง" src="/assets/logo-without-text.png" />
        </BrandImageContainer>
        <BrandImageContainer>    
          <img alt="คนอฟ" src="/assets/logo-without-text.png" />
        </BrandImageContainer>
        <BrandImageContainer>
          <img alt="rockwool" src="/assets/logo-without-text.png" />
        </BrandImageContainer>
        <BrandImageContainer>
          <img alt="shera" src="/assets/logo-without-text.png" />
        </BrandImageContainer>
      </BrandList>
      <h2>ทำไมต้องยิปสโตร์</h2>
    </Container>
  );
}
